script: |
  super -f text -I q8927.spq | sort > q8927.out

inputs:
  - name: q8927.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE + col0 + + col2 NOT BETWEEN + + col2 * 78 AND + col0 * - col1 + - col2 + + col2 + col1;
  - name: tab1

outputs:
  - name: q8927.out
    data: |
      51	14	96
      85	5	59
      91	47	68
